    created_at: "2023-10-13T23:07:05Z",
    updated_at: "2023-10-13T23:15:27Z",
    closed_at: null,
    author_association: "NONE",
    active_lock_reason: null,
    body: "React version: 18.2.0\r\n\r\n## Steps To Reproduce\r\n\r\n1. Render a Parent react component, which uses the ReactDOM apis to create a nested Child react root after mounting\r\n2. In parent, add an onClick handler which updates state on an element which wraps Child\r\n3. In child, add another onClick handler which also updates state.\r\n\r\nNote that clicks in the child should trigger both event handlers due to bubbling. \r\n\r\nLink to code example:\r\nhttps://codesandbox.io/s/kind-snowflake-cw6m9s?file=/src/App.jsx\r\n\r\nThe text elements have onClick handlers which cause the App component to rerender. Calls to the render() function are logged to the console, so that we can count renders. A single click should only ever cause one rerender due to batching. \r\n\r\n## The current behavior\r\nClicking on `This is the outer root` or `This is a child in the outer root` results in a single render. Clicking on `This is the child root` renders twice.\r\n\r\n## The expected behavior\r\nState updates should be batched despite being in separate React roots. `This is the child root` should also only render once. This is the behavior in React 16: https://codesandbox.io/s/lingering-snow-z83m39?file=/src/index.js\r\n\r\nI believe this is due to the event delegation changes in R17. Prior to R17, React only attached one listener to the document body, whereas now we have one listener for each root. Render batching is performed *within* the listener: https://github.com/facebook/react/blob/4337c1c00609ec8d7ae399c736e9d37bb159fac5/packages/react-dom/src/events/DOMPluginEventSystem.js#L632\r\n\r\nwhich prevents event handlers from separate listeners (i.e, roots) from being batched. It's hard to tell if batching is really the expected behavior, but it did happen in React 16 and I found this ancient issue mentioning it: https://github.com/facebook/react/issues/1227\r\n",
