    author_association: "NONE",
    active_lock_reason: null,
    body: "<!--\r\n  Please provide a clear and concise description of what the bug is. Include\r\n  screenshots if needed. Please test using the latest version of the relevant\r\n  React packages to make sure your issue has not already been fixed.\r\n-->\r\n\r\nReact version: 18.2.0\r\n\r\n(React 17.0.2 doesn't have this problem)\r\n\r\n## Steps To Reproduce\r\n\r\n1. Develop a component that throws an error during rendering, **but only once**.\r\n2. Implement an Error Boundary component with a `getDerivedStateFromError` static method, which updates its state to indicate the presence of an error.\r\n3. Enhance the Error Boundary's render method with conditional logic to display an error message when an error is captured.\r\n4. Wrap the component within the Error Boundary.\r\n\r\n<!--\r\n  Your bug will get fixed much faster if we can run your code and it doesn't\r\n  have dependencies other than React. Issues without reproduction steps or\r\n  code examples may be immediately closed as not actionable.\r\n-->\r\n\r\nLink to code example: https://codesandbox.io/s/react-18-error-boundary-wrkgry\r\n\r\n<!--\r\n  Please provide a CodeSandbox (https://codesandbox.io/s/new), a link to a\r\n  repository on GitHub, or provide a minimal code example that reproduces the\r\n  problem. You may provide a screenshot of the application if you think it is\r\n  relevant to your bug report. Here are some tips for providing a minimal\r\n  example: https://stackoverflow.com/help/mcve.\r\n-->\r\n\r\n## The current behavior\r\n\r\nIf a component has code that throws an error **only once** during all the renders, then the Error Boundary will call the static method `getDerivedStateFromError`, update its state, and invoke its render method.\r\n\r\nThe Error Boundary component will be in a state where it should display an error message instead of `children`. However, React does not update it, despite the state being changed and `render` method being called. Additionally, the `componentDidCatch` method is not called, even though `getDerivedStateFromError` is invoked.\r\n\r\nThe component that threw the error will **still be displayed.**\r\n\r\n**However, I expect React to update the Error Boundary immediately after the first error**\r\n\r\nI believe that this contradicts the concept outlined in [the old React documentation](https://legacy.reactjs.org/docs/error-boundaries.html#new-behavior-for-uncaught-errors):\r\n\r\n> We debated this decision, but in our experience it is worse to leave corrupted UI in place than to completely remove it.\r\n\r\n## The expected behavior\r\n\r\nJust as in React 17.0.2, I expect that immediately after the first error thrown in the component, React will not only call the `getDerivedStateFromError` method in the nearest Error Boundary, update its state, and invoke the `render` method, but it will also call the `componentDidCatch` method and apply changes to the screen according to its state: hiding `children` and displaying an error message. \r\n\r\nOtherwise, if React deems that a component, which threw an error  is still displayable on the screen, then why isn't `componentDidCatch` called at the very least? I expect to report the error to my reporting service, but I'm unable to do so in React 18.2.0",
