    body: "Adds new Jest configs for running our test suite using React Native feature flags. This includes a special config for the version of RN that Meta uses for internal dogfooding, similar to the equivalent ones used for Meta's web codebase.\r\n\r\nPractically speaking, the main benefit is we can run our tests in CI with the experimental flags used at Meta without having to enable them in the open source builds.\r\n\r\nUsage:\r\n\r\n```sh\r\nyarn test -r=native-oss\r\nyarn test -r=native-fb\r\nyarn test -r=native-fb --no-variant\r\n```",
