    body: "<!--\r\n  Please provide a clear and concise description of what the bug is. Include\r\n  screenshots if needed. Please test using the latest version of the relevant\r\n  React packages to make sure your issue has not already been fixed.\r\n-->\r\nWhen a SSR file is being wrongly considered as an RSC, the error log is not easy to understand. After #27436 react-dom started importing only the react.shared-subset file and not the react.production. This causes the error [here](https://github.com/facebook/react/blob/dddfe688206dafa5646550d351eb9a8e9c53654a/packages/react-server/src/ReactFizzServer.js#L3504) where `ReactCurrentCache` is undefined. Although this is the correct behavior, a better error message would help to understand the issue.\r\n\r\nReact version: `canary`, `>= 18.3.0-canary-a6ed60a8e-20230929`\r\n\r\n## Steps To Reproduce\r\n\r\n1. Wrongly consider an SSR file as part of RSC (react-server condition)\r\n\r\n<!--\r\n  Your bug will get fixed much faster if we can run your code and it doesn't\r\n  have dependencies other than React. Issues without reproduction steps or\r\n  code examples may be immediately closed as not actionable.\r\n-->\r\n\r\nLink to code example: https://github.com/HenriqueLimas/rsc-example/tree/wrong-ssr\r\n\r\n<!--\r\n  Please provide a CodeSandbox (https://codesandbox.io/s/new), a link to a\r\n  repository on GitHub, or provide a minimal code example that reproduces the\r\n  problem. You may provide a screenshot of the application if you think it is\r\n  relevant to your bug report. Here are some tips for providing a minimal\r\n  example: https://stackoverflow.com/help/mcve.\r\n-->\r\n\r\n## The current behavior\r\n\r\nBy running the code we receive this error\r\n\r\n```\r\nTypeError: Cannot read properties of undefined (reading 'current')\r\n```\r\n\r\n## The expected behavior\r\nA better error message similar to the one used on `react-server` (_The \"react\" package in this environment is not configured correctly. `_) would be better to understand the error",
